import React, { useState, useRef, useEffect } from 'react';
import axios from 'axios';
import kilter_board from '../assets/kilter_board.png'; // Ensure the path is correct
import './RouteOps.css'; // Make sure the CSS file is named correctly and imported
import { useNavigate } from 'react-router-dom';
import { useLocation } from 'react-router-dom';

const RouteOps = () => {
    const location = useLocation();
    const navigate = useNavigate();
    const { holds, response } = location.state || {};
    console.log(holds);
    console.log(response);

    // Function to get unique keys from the holds objects
    const getHoldKeys = () => {
        if (holds && holds.length > 0) {
            return Object.keys(holds[0]);
        }
        return [];
    };

    const holdKeys = getHoldKeys();
    const moveTypes = response && response.beta
        ? Array.from(new Set(response.beta.map(move => move.move_type)))
        : [];

    return (
        <>
        <div>
            <h1>Update Holds</h1>
            <select name="hold_id" className="hold_id">
                {holds && holds.map(hold => (
                    <option key={hold.id} value={hold.id}>
                        {`Hold ID: ${hold.id}`}
                    </option>
                ))}
            </select>
            <select name="hold_property" className="hold_property">
                {holdKeys.map((key, index) => (
                    <option key={index} value={key}>
                        {key}
                    </option>
                ))}
            </select>
            <input type="text" name="hold_value" className="hold_value" />
            <button type="submit" className="submit">Confirm</button>
        </div>

        <div>
            <h1>Delete Holds</h1>
            <select name="hold_id" className="hold_id">
                {holds && holds.map(hold => (
                    <option key={hold.id} value={hold.id}>
                        {`Hold ID: ${hold.id}`}
                    </option>
                ))}
            </select>
            <button type="submit" className="submit">Confirm</button>
        </div>

        <div>
            <h1>Delete Moves</h1>
            <select name="move_type" className="move_type">
                {moveTypes.map((moveType, index) => (
                    <option key={index} value={moveType}>
                        {moveType}
                    </option>
                ))}
            </select>
        </div>
        </>
    );
}

export default RouteOps;
